import React from "react";
class Display extends React.Component {
	constructor(props) {
		super(props);

		this.state = {
			items: [],
			DataisLoaded: false,
            error:null
		};
	}

	componentDidMount() {
		fetch(
"https://jsonplaceholder.typicode.com/todos")
			.then((res) => res.json())
			.then((json) => {
				this.setState({
					items: json,
					DataisLoaded: true,

				});
			},
            (error) => {
                this.setState({
                  isLoaded: true,
                  error:error
                });
              }
            )
	}
	render() {
		const {error, DataisLoaded, items } = this.state;

        if(error){
            return <div>Error: {error.message}</div>
        }
		else if (!DataisLoaded)
         return <div>Loading...</div>;

		return (
            <div>
            {items.map(item => (
              <div key={item.id}>
                User Id : {item.userId} <br/>
                Title : {item.title} <br/>
                completed :{item.completed?'True':'False'}<hr/>
              </div>

            ))}

          </div>
	);
}
}

export default Display;
